<!DOCTYPE html>
<html>
    <head>
        <title>
   Zapis z TVY
        </title>
        <meta charset="utf-8">
        <meta content="Zapis z TVY" property="og:title">
        <meta content="website" property="og:type">
        <meta content="./" property="og:url">
        <meta content="" property="og:image">
        <meta content="Zapis z hodiny TVY" property="og:description">
        <link href="//cdn.muicss.com/mui-0.9.30/css/mui.min.css" rel="stylesheet" type="text/css">
        <script src="//cdn.muicss.com/mui-0.9.30/js/mui.min.js">
        </script>
    </head>
    <body>
        <div class="mui-container">
            <h1>
                TVY &ndash; Terminologie
            </h1>
            <p>
                <strong>
                    Data
                </strong>
                &ndash; Nějak&aacute; informace v&nbsp;digit&aacute;ln&iacute; podobě
                <br>
                <strong>
                    Informace
                </strong>
                &ndash; k&oacute;dovan&aacute; data, srozumiteln&aacute; př&iacute;jemci, 1bit - 1/0
            </p>
            <p>
                Program je složen z&nbsp;instrukc&iacute; (instrukce = předpis k&nbsp;proveden&iacute; činnosti)
                <br>
                <strong>
                    Strojov&aacute; instrukce
                </strong>
                &ndash; element&aacute;rn&iacute; operace procesoru, Z&aacute;kladn&iacute; jednotka strojov&eacute;ho k&oacute;du
                <br>
                <strong>
                    Instrukčn&iacute; sada
                </strong>
                (strojov&iacute; k&oacute;d):
            </p>
            <ul>
                <li>
                    skupina instrukc&iacute; kter&yacute;m rozum&iacute; procesor
                </li>
                <li>
                    Každ&aacute; instrukce je tvořena ze dvou č&aacute;st&iacute;:
                </li>
                <li>
                    K&oacute;d operace (co se bude dělat)
                </li>
                <li>
                    K&oacute;d adresy (s č&iacute;m se bude pracovat)
                </li>
            </ul>
            <p>
                Program je v&nbsp;programovac&iacute;m jazyce a předěl&aacute; ho do stroj k&oacute;du. Dva typy překladačů programovac&iacute;ch jazyků:
            </p>
            <ul>
                <li>
                    Kompilovan&yacute; (po přeložen&iacute; se spust&iacute;)
                </li>
                <li>
                    Interpretovan&yacute; (postupně se překl&aacute;d&aacute; a vykon&aacute;v&aacute;)
                </li>
            </ul>
            <p>
                <strong>
                    Asembler
                </strong>
                &ndash; jazyk symbolick&yacute;ch adres
            </p>
            <p>
                <strong>
                    Instrukce
                </strong>
                :
            </p>
            <ul>
                <li>
                    Aritmetick&aacute;
                </li>
                <li>
                    Logick&aacute;
                </li>
                <li>
                    Přesun &ndash; mezi registry
                </li>
                <li>
                    Posun
                </li>
                <li>
                    Ř&iacute;d&iacute;c&iacute; instrukce
                </li>
                <li>
                    V&yacute;stupn&iacute; instrukce
                </li>
            </ul>
            <p>
                <strong>
                    Takt
                </strong>
                &ndash; element&aacute;rn&iacute; č&aacute;st prov&aacute;děn&eacute;ho cyklu, nejmen&scaron;&iacute; č&aacute;st strojov&eacute; instrukce
            </p>
            <h2>
                Von Neumanovo Sch&eacute;ma
            </h2>
            <p>
                <strong>
                    <img src="data:image/jpeg;base64,">
                </strong>
            </p>
            <p>
                <strong>
                    ALU
                </strong>
                &ndash; prov&aacute;d&iacute; aritmetick&eacute; operace a logick&eacute;
            </p>
            <p>
                <strong>
                    Operačn&iacute; paměť
                </strong>
                &ndash; rozdělen&aacute; na buňky,
                <strong>
                    paměť je pro data a instrukce stejn&aacute;
                </strong>
                lze zapisovat jen data nebo instrukce. Nelže současně zapisovat protože použ&iacute;vaj&iacute; stejnou sběrnici.
            </p>
            <p>
                <strong>
                    Řadič
                </strong>
                &ndash; ř&iacute;d&iacute; činnost poč&iacute;tače, odes&iacute;l&aacute; ř&iacute;d&iacute;c&iacute; sign&aacute;ly a př&iacute;m&aacute; stavov&aacute; hl&aacute;&scaron;en&iacute;
            </p>
            <h2>
                Harvardsk&eacute; sch&eacute;ma
            </h2>
            <p>
                <img src="data:image/jpeg;base64,">
            </p>
            <p>
                <strong>
                    Paměť pro Instrukce
                </strong>
                &ndash; programy
            </p>
            <p>
                <strong>
                    Paměť pro data
                </strong>
                &ndash; data
            </p>
            <ul>
                <li>
                    každ&aacute; paměť se adresuje zvl&aacute;&scaron;ť
                </li>
                <li>
                    č&iacute;st lze paralelně
                </li>
            </ul>
            <p>
                Dne&scaron;n&iacute; procesory spojuj&iacute; obě tyto architektury. Uvnitř harvardsk&aacute; struktura, ale zvenku se chov&aacute; jako Von Neumannovo sch&eacute;ma, protože nač&iacute;t&aacute; data pomoc&iacute; jedn&eacute; sběrnice.
            </p>
            <p>
                <strong>
                    CPU
                </strong>
                (Central Procesing Unit)
            </p>
            <ul>
                <li>
                    centr&aacute;ln&iacute; v&yacute;početn&iacute; jednotka
                </li>
                <li>
                    &uacute;kolem je nač&iacute;tat instrukce a vykon&aacute;vat program
                </li>
            </ul>
            <p>
                <strong>
                    ALU
                </strong>
            </p>
            <ul>
                <li>
                    Poč&iacute;t&aacute;
                </li>
            </ul>
            <p>
                <strong>
                    Operačn&iacute; paměť
                </strong>
            </p>
            <ul>
                <li>
                    (dočasn&eacute; ukl&aacute;d&aacute;n&iacute; do paměti)
                </li>
                <li>
                    m&iacute;sto, kam se ukl&aacute;daj&iacute; programy
                </li>
            </ul>
            <p>
                <strong>
                    Vstupn&iacute; / V&yacute;stupn&iacute; zař&iacute;zen&iacute;
                </strong>
            </p>
            <ul>
                <li>
                    zpracov&aacute;v&aacute; a zad&aacute;v&aacute; data
                </li>
            </ul>
            <p>
                <strong>
                    Řadič
                </strong>
            </p>
            <ul>
                <li>
                    ř&iacute;d&iacute; činnost v&scaron;ech č&aacute;st&iacute; PC
                </li>
                <li>
                    dost&aacute;v&aacute; stavov&aacute; hl&aacute;&scaron;en&iacute;
                </li>
            </ul>
            <h1>
                Souč&aacute;sti procesoru
            </h1>
            <p>
                <img src="data:image/jpeg;base64,">
            </p>
            <p>
                J&aacute;dro &ndash; řadič + registry + ALU
            </p>
            <p>
                CACHE = rychl&aacute; mezi paměť
            </p>
            <ul>
                <li>
                    slouž&iacute; pro nač&iacute;t&aacute;n&iacute; dat z&nbsp;pomalej&scaron;&iacute;ch pamět&iacute;
                </li>
            </ul>
            <p>
                <strong>
                    Řadič
                </strong>
            </p>
            <ul>
                <li>
                    dek&oacute;duje instrukce
                </li>
                <li>
                    řad&iacute; instrukce(vnitřn&iacute; pořad&iacute;)
                </li>
            </ul>
            <p>
                <strong>
                    ALU
                </strong>
                &ndash; aritmetick&eacute; a logick&eacute; operace
            </p>
            <p>
                <strong>
                    Registr
                </strong>
                &ndash; uchov&aacute;v&aacute; data se kter&yacute;mi se pr&aacute;vě pracuje
            </p>
            <p>
                <strong>
                    FPU
                </strong>
            </p>
            <ul>
                <li>
                    matematick&yacute; koprocesor
                </li>
                <li>
                    star&aacute; se o operace s&nbsp;plovouc&iacute; ř&aacute;dovou č&aacute;rkou
                </li>
            </ul>
            <p>
                <strong>
                    Proces
                </strong>
            </p>
            <ul>
                <li>
                    program kter&yacute; běž&iacute;
                </li>
                <li>
                    m&aacute; př&iacute;stup k&nbsp;určit&eacute; č&aacute;sti paměti, syst&eacute;mov&yacute;ch zdrojů (soubory, porty, sběrnice)
                </li>
            </ul>
            <p>
                <strong>
                    Adresov&yacute; prosto
                </strong>
                r &ndash; souhrn adres, ke kter&yacute;m sten proces může přistupovat
            </p>
            <p>
                <strong>
                    Sběrnice
                </strong>
            </p>
            <ul>
                <li>
                    skupina vodičů kter&aacute; zaji&scaron;tuje přenos dat/instrukc&iacute;
                </li>
                <li>
                    každ&aacute; m&aacute; svůj protokol(pravidla pro přenos)
                </li>
            </ul>
            <h2>
                Blokov&eacute; sch&eacute;ma procesoru
            </h2>
            <p>
                <img src="data:image/jpeg;base64,">
            </p>
            <p>
                <strong>
                    ALU
                </strong>
                -slouž&iacute; k&nbsp;prov&aacute;děn&iacute;
            </p>
            <p>
                <strong>
                    SWE
                </strong>
            </p>
            <ul>
                <li>
                    Status Words Registrs
                </li>
                <li>
                    Registr stavov&eacute;ho slova
                </li>
                <li>
                    V&iacute; zda operace proběhla ok
                </li>
                <li>
                    Je zde zaps&aacute;n stav akumul&aacute;toru (ACC)
                </li>
            </ul>
            <p>
                <strong>
                    TEMP
                </strong>
            </p>
            <ul>
                <li>
                    Registr
                </li>
                <li>
                    Připojen k&nbsp;ALU, může b&yacute;t připojen k&nbsp;FPU
                </li>
                <li>
                    Slouž&iacute; k&nbsp;uložen&iacute; 1 operandu (operand = hodnota se kterou se poč&iacute;t&aacute;)
                </li>
                <li>
                    Slouž&iacute; k&nbsp;dočasn&eacute;mu ukl&aacute;d&aacute;n&iacute;
                </li>
            </ul>
            <p>
                <strong>
                    ACC
                </strong>
            </p>
            <ul>
                <li>
                    Akumul&aacute;tor, střadač
                </li>
                <li>
                    Zapisuj&iacute; se zde v&yacute;sledky z&nbsp;ALU
                </li>
            </ul>
            <p>
                Př.: Přičti adresu
                <br>
                Hodnota z&nbsp;dan&eacute; adresy se bude přič&iacute;tat k&nbsp;hodnotě ACC a v&yacute;sledek se zap&iacute;&scaron;e do ACC
            </p>
            <ul>
                <li>
                    ACC je u jednodu&scaron;&scaron;&iacute;ch procesorů, u složitěj&scaron;&iacute;ch CPU jsou datov&eacute; registry, maj&iacute; podobnou funkci
                </li>
                <li>
                    Použ&iacute;v&aacute; se jako implicitn&iacute; operand pro různ&eacute; operace
                </li>
                <li>
                    Slouž&iacute; pro uložen&iacute; č&iacute;seln&yacute;ch hodnot
                </li>
            </ul>
            <p>
                <strong>
                    Budič sběrnice
                </strong>
            </p>
            <ul>
                <li>
                    Zesiluje sign&aacute;l
                </li>
                <li>
                    Odděluje provoz, co jde dovnitř a co jde ven
                </li>
            </ul>
            <p>
                <strong>
                    Datov&aacute; sběrnice
                </strong>
                &ndash; umožnuje v&yacute;měnu dat
            </p>
            <p>
                <strong>
                    FIFO
                </strong>
            </p>
            <ul>
                <li>
                    Fronta, Frst In Frst Out
                </li>
                <li>
                    Dopředu se nahr&aacute;v&aacute; několik instrukc&iacute; (vět&scaron;inou 8)
                </li>
                <li>
                    Když nějakou nepotřebuje tak ji zahod&iacute;
                </li>
            </ul>
            <p>
                <strong>
                    Dekod&eacute;r
                </strong>
                &ndash; rozkl&aacute;d&aacute; instrukce na mikroinstrukce
            </p>
            <p>
                <strong>
                    Řadič
                </strong>
                &ndash; ř&iacute;d&iacute; celou činnost
            </p>
            <p>
                DB = DATA BUS = datov&aacute; sběrnice
            </p>
            <p>
                CB = Control Bus= ř&iacute;d&iacute;c&iacute; sběrnice
            </p>
            <ul>
                <li>
                    Pos&iacute;l&aacute; př&iacute;kazy jednotce, kter&aacute; je na adresovan&aacute;
                </li>
            </ul>
            <p>
                <strong>
                    GPE
                </strong>
                = General Putopse Register= obecně užitečn&eacute; registry
            </p>
            <ul>
                <li>
                    Pro data i instrukce
                </li>
                <li>
                    Pro v&yacute;sledky , aby nemusely do hlavn&iacute; paměti
                </li>
            </ul>
            <p>
                <strong>
                    Segmentov&eacute; registry
                </strong>
            </p>
            <ul>
                <li>
                    Vypoč&iacute;t&aacute; se zde adresa instrukce pak se na CB
                    <ul>
                        <li>
                            CS = Control Segment
                            <ul>
                                <li>
                                    Segment
                                </li>
                                <li>
                                    CS +IP =&gt; adresa instrukce
                                </li>
                            </ul>
                        </li>
                        <li>
                            SS = Stack Segment (stack = za&aacute;sobn&iacute;k)
                        </li>
                        <li>
                            DS = Data Segment
                        </li>
                        <li>
                            ES = Extra Segment
                            <ul>
                                <li>
                                    Např.: pro řetězce
                                </li>
                            </ul>
                        </li>
                        <li>
                            FS = Free
                            <ul>
                                <li>
                                    Pro voln&eacute; využit&iacute;
                                </li>
                            </ul>
                        </li>
                    </ul>
                </li>
            </ul>
            <p>
                <strong>
                    Instrukčn&iacute; ukazatel
                </strong>
            </p>
            <ul>
                <li>
                    Č&Iacute;RAČ INSTRUKC&Iacute; &lt;3 (MISS YOU HAJI)
                </li>
                <li>
                    Obsahuje adresu instrukce, kter&aacute; se bude prov&aacute;dět v&nbsp;dal&scaron;&iacute;m taktu
                </li>
                <li>
                    Automaticky se to o jednotu zvy&scaron;uje
                </li>
            </ul>
            <p>
                <strong>
                    Stack pointer
                </strong>
            </p>
            <ul>
                <li>
                    Ukazatel z&aacute;sobn&iacute;ku
                </li>
                <li>
                    Ukazuje na vrchol z&aacute;sobn&iacute;ku
                </li>
                <li>
                    STACK = odkl&aacute;dac&iacute; z&aacute;sobn&iacute;k
                </li>
                <li>
                    Ukl&aacute;daj&iacute; se sem adresy n&aacute;vratov&yacute;ch instrukc&iacute;
                </li>
            </ul>
            <p>
                <strong>
                    Buffer
                </strong>
                = vyrovn&aacute;vac&iacute; paměť
            </p>
            <p>
                <strong>
                    AB
                </strong>
                = Adress Bus = adresov&aacute; sbernice
            </p>
            <p>
                Code segment + Instruction Pointer = adresa
            </p>
            <p>
                Cs	+	IP	=	č&iacute;slo se kter&yacute;m se bude pracovat
            </p>
            <h3>
                Code segment???
            </h3>
            <p>
                Mal&eacute; procesory maj&iacute; m&iacute;sto Code segmentu Program counter, kter&yacute; obsahuje absolutn&iacute; adresu, kter&aacute; se mus&iacute; vypoč&iacute;tat.
            </p>
            <p>
                Vezme se obsah těchto registrů a najde se v&nbsp;operačn&iacute; paměti adresa, z&nbsp;adresy se vezme adresa instrukce, kter&aacute; se bude prov&aacute;dět. Aby se mohla instrukce prov&aacute;dět mus&iacute; b&yacute;t zaps&aacute;na v&nbsp;CS a IP, cel&yacute; program je sled instrukc&iacute;, jakmile se instrukce provede o jednotku d&eacute;lky se instrukce CS
            </p>
            <p>
                Stack pointer + Stack segment = adresa kam byla naposledy zaps&aacute;na adresa, ukazuje na vrchol z&aacute;sobn&iacute;ků
            </p>
            <p>
                Po zaps&aacute;ni hodnoty na ni ukazuje, tak dlouho dokud, nen&iacute; přečtena
            </p>
            <p>
                Ukl&aacute;d&aacute;m-li zmen&scaron;uje se pointer
            </p>
            <p>
                Čtu-li zvy&scaron;uje se pointer
            </p>
            <p>
                Dno m&aacute; nejvy&scaron;&scaron;&iacute; adresu
            </p>
            <p>
                <strong>
                    Fronata FIFO
                </strong>
            </p>
            <p>
                <strong>
                    Z&aacute;sobn&iacute;k LIFO
                </strong>
            </p>
            <p>
                <strong>
                    Stack
                </strong>
                = č&aacute;st operačn&iacute; paměti
            </p>
            <ul>
                <li>
                    Každy program včetně OS m&aacute; svůj stack
                </li>
            </ul>
            <h2>
                Přeru&scaron;en&iacute;
            </h2>
            <ul>
                <li>
                    Schopnost procesoru přeru&scaron;it pr&aacute;vě vykon&aacute;van&yacute; program a zač&iacute;t vykon&aacute;vat jin&yacute;(obsluhu přeru&scaron;en&iacute;)
                </li>
                <li>
                    Čast&aacute; věc při přep&iacute;n&aacute;n&iacute; procesů
                </li>
            </ul>
            <p>
                Typy přeru&scaron;en&iacute;:
            </p>
            <ul>
                <li>
                    Vněj&scaron;&iacute; (asynchronn&iacute;)
                    <ul>
                        <li>
                            nečekan&eacute;/nepl&aacute;novan&eacute;
                        </li>
                        <li>
                            zm&aacute;čknut&iacute; kl&aacute;vesy
                        </li>
                    </ul>
                </li>
                <li>
                    Vnitřn&iacute; (asynchronn&iacute;)
                    <ul>
                        <li>
                            Vykon&aacute;v&aacute; je s&aacute;m procesor
                        </li>
                        <li>
                            Probl&eacute;m s&nbsp;vykon&aacute;vanou instrukc&iacute;
                        </li>
                        <li>
                            Dělen&iacute; 0
                        </li>
                        <li>
                            Nečekan&eacute;
                        </li>
                    </ul>
                </li>
                <li>
                    SW (synchronn&iacute;)
                    <ul>
                        <li>
                            Speci&aacute;ln&iacute; strojov&aacute; instrukce
                        </li>
                        <li>
                            Oček&aacute;van&eacute;
                        </li>
                        <li>
                            Vypl&iacute;v&aacute; z&nbsp;podstaty programu
                        </li>
                    </ul>
                </li>
                <li>
                    Maskovan&eacute;
                    <ul>
                        <li>
                            Slouž&iacute; ovladačům
                        </li>
                    </ul>
                </li>
                <li>
                    Nemaskovan&eacute;
                    <ul>
                        <li>
                            V&yacute;padek zdrojů
                        </li>
                        <li>
                            Mus&iacute; se prov&eacute;st
                        </li>
                    </ul>
                </li>
            </ul>
            <div class="paticka" style="text-align: center;">
                <hr>
                <p style="text-align: center; font-size: 75%; border:0%; padding:0%">
